import React, { Component } from 'react';
import "../components/style/input_feild.scss";

export default class Input_feild extends Component {
    constructor(props) {
        super(props);
        this.state = {
          input_value: "",
          status: false,
          copy_status: "copy",
          fetchingStatus: "SHORTEN",
          resultData: "",
          errorMsg: ""
        };
      }

    render() {
        return (
           <div className="input_field">
               <div className="input_field_inner">
                   <form>


                      <label For="input_url"></label>
                      <span className="input_url">
                          <input type="text" placeholder="Shorten a link here..." onChange={this.getUserURL} /></span>
                          <label For="input_submit"></label>
                      <span className="input_submit">  <input type="submit" value="Shorten!" /></span>

                      </form>
               </div>
           </div>
        )
    }
}
